import { Conta } from "../conta/conta";
import { Paciente } from "../paciente";

export class ControleCaixa {

    idControleCaixa?: number;
    idPaciente?: Paciente;
    conta?: Conta[] = [];
    data?: Date;
    produtoOuCliente?: string;
    preco?: number;
    formaPagamento?: string;
    lancamentoFuturo?: string;
}
